import './App.css';
import React from 'react';
import Search from './Search.js';
import UploadDoc from './UploadDoc.js';
import Doc from './Doc.js';

function App() {
  const [docs, updateDocs] = React.useState([]);

  const imageUploaded = (doc) => {
    let updatedDocs = docs
    updatedDocs.push(doc)
    console.log(doc)
    //updateDocs(docs => [...docs, updatedDocs])
  }

  const displayDocs = () => {
    return docs.map(doc => <Doc source={doc} key={doc.name} className="doc"/>);
  }

  return (
    <div className="App">
      <Search />
      <UploadDoc imageUploaded={imageUploaded}/>
      <div className="docs_container">
        {
          displayDocs()
        }
      </div>
    </div>
  );
}

export default App;
